import React, {useState} from 'react'

export default function Form() {

    const [name, setName] = useState("")
    const [email, setEmail] = useState("")
    const [pin, setPin] = useState("")
    const [message, setMessage] = useState("")

    const SubmitForm = () => {
        try {
            const content =  {name, email, pin, message}
            const res = fetch("http://localhost:5000/post", {
                method: "POST",
                headers: "application/json",
                content: content
            })
        } catch (error) {
            console.log(error.message)
        }
    }

    return (
        <div className="body-content">
            <form className="form-content" onSubmit={SubmitForm}>
                <label for="form-name-input" id="form-name-label">Name</label>
                <input type="text" id="form-name-input"></input>
                <label for="form-email-input" id="form-email-label">Email</label>
                <input type="text" id="form-email-input"></input>
                <label for="form-pin-input" id="form-pin-label">Pin</label>
                <input type="number" id="form-pin-input"></input>
                <label for="form-message-input" id="form-message-label">Message</label>
                <input type="text" id="form-message-input"></input>
                <input type="submit" className="btn"></input>
            </form>
        </div>
    )
}
